import React from 'react'
import { IonPage, IonCard, IonHeader, IonToolbar, IonBackButton, IonContent, IonTitle, IonButtons, IonTextarea,
    IonCardContent, IonLabel, IonItem, IonInput} from '@ionic/react'


const addItems = (array) => {
    const result = array.filter(arrayItem => arrayItem[1])
                        .map(arrayItem => 
        <IonItem>
            <IonInput placeholder={arrayItem[0]}
                name={arrayItem[0]}
                ></IonInput>
        </IonItem> 
        )
    return result
}
